/* Energy Switch Gaurantee - Refunds */
select * from (
select
  ta.account_id as account_id,
  ta.supplyenddate as account_end_date,
  at2.creationdetail_createddate as transaction_date,
  at2.transactiontype as transaction_type,
  at2.transactiontypefriendlyname description,
  at2.iscancelled,
  at2.amount,
  at2.actions,
  at2.statementid,
  row_number() over (partition by ta.account_id order by at2.creationdetail_createddate) row_num

--   ac.status
from temp_account_id ta
     left outer join ref_cdb_supply_contracts su on su.external_id = ta.account_id
     left outer join aws_s3_stage2_extracts.stage2_accounttransactions at2 on at2.account_id = ta.account_id
                 and cast(creationdetail_createddate as timestamp) >= ta.supplyenddate and upper(transactiontype) = 'BILL'
order by ta.account_id, cast(creationdetail_createddate as timestamp)
) x
where x.row_num = 1;



truncate temp_account_id;
